import React from "react"
import { useFormik } from 'formik'

const Login = (props) => {

    const formik = useFormik({
        initialValues: {
            login: '',
            password: '',
            rememberMe: true
        },
        onSubmit: ''
    }

    )

    console.log(formik)
    return (
        <>
        <div><input id='login' name='login' type='text' placeholder='login' value={formik.values.login} onChange={formik.handleChange} /></div>
        <div><input id='password' name='password' type='password' placeholder='password' value={formik.values.password}/></div>
        <div><input id='rememberMe' name='rememberMe' type='checkbox' value={formik.values.rememberMe}/></div>
        </>
    )

}

export default Login
